const state = useState;

const [count, setCount] = useState(0);

const Incnum = () => {
    setCount(count+1);
} 




const App = () => {
    





    return(
        <>
            <div className="container">
                <h1>{count}</h1>
                <button onClick={Incnum}>CLICK ME</button>
            </div>
        </>
    )
}





export default App;
